const API_URL = process.env.REACT_APP_API_URL;

const SearchService = {
    fetchSearches:() => {
        debugger
        return fetch(`${API_URL}/searches`, {
            credentials: "same-origin"
          })
        .then((response) => {
            debugger
        })
    }
}

export default SearchService;
